import styled from 'styled-components'

export const GenericStyle=styled.div`

min-height: 100%;
min-width: 1024px;


width: 100%;
height: auto;


position: fixed;
top: 0;
left: 0;
background: #282c34;
color: white;
`

export const Styles = styled.div`
padding: 1rem;

table {
  border-collapse:separate;
  border-radius:6px;


  border-spacing: 0;
  border: 1px solid #ddd;
  tr {
    :last-child {
      td {
        border-bottom: 0;
      }
    }
  }
  th,
  td {
    margin: 0;
    padding: 0.5rem;
    border-left:solid #ddd 1px;
    border-top:solid #3e444f 1px;
    border-bottom: 1px solid #ddd;
    border-right: 1px solid #3e444f; 
    :last-child {
      border-right: 0;
    }
  }
  th {
    background-color: blue;
    border-top: none;
}
  td:first-child, th:first-child {
    border-left: none;
}
}
`
